import React from "react";
import {
    Button,
    Container,
    Divider,
    Paper,
    TextField,
    Typography,
} from "@mui/material";
import { Box, Stack } from "@mui/system";
import AddIcon from "@mui/icons-material/Add";

function ClientesBusqueda() {
    const boxStyle = {
        sx: {
            width: "100vw",
            minHeight: "100vh",
            height: "100%",
            backgroundColor: "#dbdbdb",
            m: 0,
            p: 0,
        },
    };

    const paperStyle = {
        sx: {
            width: "100%",
            minWidth:'250px',
            
        },
    };

    const inputsStackStyle = {
        sx: { width: "25%", minWidth:'200px', m: 1 },
    };

    return (
        // <Container fixed>
        <Box {...boxStyle}>
            <Container >
                <Stack
                    {...paperStyle}
                    direction={"row"}
                    justifyContent="space-between"
                >
                    <Typography variant="h6">Personas</Typography>
                    <Button variant="filled">
                        <AddIcon />
                        Nuevo
                    </Button>
                </Stack>
                <Paper {...paperStyle}>
                    <Typography variant={"h6"}>Filtros</Typography>
                    <Divider />
                    <Stack flexDirection={{xs:"column", sm:'row'}}>
                        <Stack {...inputsStackStyle}>
                            <Typography variant={"body2"}>Nombre</Typography>
                            <TextField></TextField>
                        </Stack>
                        <Stack {...inputsStackStyle}>
                            <Typography variant={"body2"}>
                                Tipo documento
                            </Typography>
                            <TextField></TextField>
                        </Stack>
                    </Stack>
                    <Stack></Stack>
                </Paper>
            </Container>
        </Box>
        // </Container>
    );
}

export default ClientesBusqueda;
